import React from "react";
import Category from '../Category/Category'
import styles from './CategoryList.module.css';

const CategoryList = () => {
  const categories = ["asdfasd","asdfasfa"];

  return (
    <nav className={styles.navCategories}>
      <h2 onClick={onClick.bind(this, "")}>Categories</h2>

      <ul>
        <Category name="All Categories"></Category>
        {categories &&
          categories.map((category, i) => (
            <Category key={i} name={category}></Category>
          ))}
      </ul>
    </nav>
  );
};

export default CategoryList;
